import React, { Component } from 'react'
// data.js
const profiles = [
    {
      id: 1,
      userID: '1',
      favoriteMovieID: '1',
    },
    {
      id: 2,
      userID: '2',
      favoriteMovieID: '1',
    },
    {
      id: 3,
      userID: '4',
      favoriteMovieID: '5',
    },
    {
      id: 4,
      userID: '5',
      favoriteMovieID: '2',
    },
    {
      id: 5,
      userID: '3',
      favoriteMovieID: '5',
    },
    {
      id: 6,
      userID: '6',
      favoriteMovieID: '4',
    },
  ];

  const users = {
    1: {
      id: 1,
      name: 'Jane Jones',
      userName: 'coder',
    },
    2: {
      id: 2,
      name: 'Matthew Johnson',
      userName: 'mpage',
    },
    3: {
      id: 3,
      name: 'Autumn Green',
      userName: 'user123',
    },
    4: {
      id: 3,
      name: 'John Doe',
      userName: 'user123',
    },
    5: {
      id: 5,
      name: 'Lauren Carlson',
      userName: 'user123',
    },
    6: {
      id: 6,
      name: 'Nicholas Lain',
      userName: 'user123',
    },
  };

  const movies = {
    1: {
      id: 1,
      name: 'Planet Earth',
    },
    2: {
      id: 2,
      name: 'Selma',
    },
    3: {
      id: 3,
      name: 'Million Dollar Baby',
    },
    4: {
      id: 4,
      name: 'Forrest Gump',
    },
    5: {
      id: 5,
      name: 'Get Out',
    },
  };


class FavMovie extends Component{
    render(){
        return(
            <div>
                {profiles.map((profile)=>{
                    const userName = users[profile.userID].name;
                    const favMovie = movies[profile.favoriteMovieID].name;
                    return(
                        <ul key={profile.id}>
                            <p>{`${userName}, ${favMovie}`}</p>
                        </ul>
                    )
                })}
            </div>
        )
    }
}

class MovieCard extends Component{
    render(){
        return(
            <div>
                {profiles.map((profile)=>{
                    return(
                        <ul key={profile.id}>
                            <p>{`${profile.name}`}</p>
                        </ul>
                    )
                })}
            </div>
        )
    }
}

export default { FavMovie, MovieCard}
